import {
    Figure, Picture, TextBox, Slide, Presentation,
} from './types'


const figure: Figure = {
    type: 'Figure',
    id: 1,
    posX: 0,
    posY: 2,
    size: 100,
    borderColor: null,
    isSelected: false,
    shape: "triangle",
    innerColor: "ffffff",
    width: 100,
    height: 10,
};

const img: Picture = {
    type: 'Image',
    id: 2,
    posX: 250,
    posY: 250,
    size: 100,
    borderColor: null,
    isSelected: false,
    path: require("../img/kot.jpg"),
};

const text: TextBox = {
    type: 'Text',
    id: 3,
    posX: 150,
    posY: 150,
    size: 400,
    borderColor: null,
    isSelected: false,
    content: "content",
    font: 'italic 1.2rem "Fira Sans", serif',
};

const slide: Slide = {
    id: 1,
    elements: [figure, img, text],
    numberOfSlide: 1,
    backgroundColor: "ffffff",
};

const slide2: Slide = {
    id: 1,
    elements: [figure, img, text],
    numberOfSlide: 1,
    backgroundColor: "ffffff",
};

export const presentation: Presentation = {
    name: "untitled1",
    slide: [slide, slide2],
    history: [],
    historyIndex: 1,
};
